import Col from 'react-bootstrap/Col';
import Container from 'react-bootstrap/Container';
import Image from 'react-bootstrap/Image';
import Row from 'react-bootstrap/Row';
import { useSelector } from 'react-redux';


export function MainContainer() {
    const {userInfo} = useSelector((store) => store.user)
    return (
        <Container>
            <Row>
                {/* <Col xs={6} md={4}>
                    <Image src="user_min.jpg" width="150" roundedCircle />
                </Col>
                <Col xs={6} md={4}>
                    <Image src="user_ching.jpg" width="150" roundedCircle />
                </Col> */}
                {userInfo.map((user) => {
                    <Col xs={6} md={4} style={{ display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
                    <div style={{ width: '25vw', height: '25vw', position: 'relative' }}>
                        <Image
                            src={user.path}
                            alt={user.name}
                            roundedCircle
                            style={{ position: 'absolute', top: 0, left: 0, width: '100%', height: '100%' }}
                        />
                    </div>
                </Col>
                })}
                
                <Col xs={6} md={4} style={{ display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
                    <div style={{ width: '25vw', height: '25vw', position: 'relative' }}>
                        <Image
                            src="user_min.jpg"
                            alt="User Min"
                            roundedCircle
                            style={{ position: 'absolute', top: 0, left: 0, width: '100%', height: '100%' }}
                        />
                    </div>
                </Col>
                <Col xs={6} md={4} style={{ display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
                    <div style={{ width: '25vw', height: '25vw', position: 'relative' }}>
                        <Image
                            src="user_ching.jpg"
                            alt="User Ching"
                            roundedCircle
                            style={{ position: 'absolute', top: 0, left: 0, width: '100%', height: '100%' }}
                        />
                    </div>
                </Col>
                <Col xs={6} md={4} style={{ display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
                    <div style={{ width: '25vw', height: '25vw', position: 'relative' }}>
                        <Image
                            src="user_ching.jpg"
                            alt="User Ching"
                            roundedCircle
                            style={{ position: 'absolute', top: 0, left: 0, width: '100%', height: '100%' }}
                        />
                    </div>
                </Col>

            </Row>
        </Container>
    )
}
